INSERT INTO `shows` (`Shows_Id`, `Type`, `Title`, `Director_Id`, `Rating_Id`, `Date_Added`, `Release_Year`, `Duration`, `Description`) VALUES
('s1', 'Movie', 'Dick Johnson Is Dead', 'D0001', 1, '2021-09-25', 2020, '90 min', 'As her father nears the end of his life, filmmaker Kirsten Johnson stages his death in inventive and comical ways to help them both face the inevitable.'),
('s10', 'Movie', 'The Starling', 'D0008', 1, '2021-09-24', 2021, '104 min', 'A woman adjusting to life after a loss contends with a feisty bird that\'s taken over her garden  and a husband who\'s struggling to find a way forward.'),
('s100', 'TV Show', 'On the Verge', 'D0002', 2, '2021-09-07', 2021, '1 Season', 'Four women  a chef, a single mom, an heiress and a job seeker  dig into love and work, with a generous side of midlife crises, in pre-pandemic LA.'),
('s1000', 'Movie', 'Stowaway', 'D0597', 2, '2021-04-22', 2021, '116 min', 'A three-person crew on a mission to Mars faces an impossible choice when an unplanned passenger jeopardizes the lives of everyone on board.'),
('s1001', 'Movie', 'Wild Dog', 'D0598', 2, '2021-04-22', 2020, '126 min', 'A brash but brilliant Indian intelligence agent leads a covert operation to nab the mastermind behind a series of attacks threatening national security.'),
('s1002', 'Movie', 'Oloibiri', 'D0599', 4, '2021-04-21', 2015, '86 min', 'After drilling depletes a small village, a corporation finds more oil in the region, igniting tensions among the community.'),
('s1003', 'Movie', 'Tell Me When', 'D0600', 2, '2021-04-21', 2021, '97 min', 'Workaholic Will puts his humdrum life in LA on hold to fulfill his grandpa\'s last wish: visiting Mexico City\'s most iconic sights and falling in love.'),
('s1004', 'TV Show', 'Zero', 'D0002', 2, '2021-04-21', 2021, '1 Season', 'A shy teen with the power to turn invisible must get it under control to help defend his neighborhood, putting aside the pursuit of his artistic dream.'),
('s1005', 'TV Show', 'Izzy\'s Koala World', 'D0002', 6, '2021-04-20', 2021, '2 Seasons', 'Young koala caretaker Izzy Bee and her family rescue cuddly creatures in need and help them head back into the wild on Australias Magnetic Island.'),
('s1006', 'Movie', 'Keymon and Nani in Space Adventure', 'D0002', 6, '2021-04-20', 2013, '76 min', 'For Rohan and his magical pal, Keymon, a trip to visit their grandmother turns into the rescue mission of a lifetime when she is kidnapped by aliens!'),
('s1007', 'Movie', 'Motu Patlu Dino Invasion', 'D0554', 7, '2021-04-20', 2018, '80 min', 'A time machine sends Motu and Patlu back to the dinosaur period, but the real trouble starts when the reptiles travel back to the present day with them!'),
('s1008', 'Movie', 'Motu Patlu in Octupus World', 'D0554', 6, '2021-04-20', 2017, '81 min', 'While returning a goldfish and an octopus from an aquarium to the sea, Motu and Patlu must also save the goldfishs family from a mean, tentacled queen.'),
('s1009', 'Movie', 'Motu Patlu VS Robo Kids', 'D0554', 6, '2021-04-20', 2019, '84 min', 'For Motu, facing off against three children becomes an unexpected challenge when he realizes they have superstrength  and a secret!'),
('s101', 'TV Show', 'Tobot Galaxy Detectives', 'D0002', 7, '2021-09-07', 2019, '2 Seasons', 'An intergalactic device transforms toy cars into robots: the Tobots! Working with friends to solve mysteries, they protect the world from evil.'),
('s1010', 'Movie', 'Rudra: Secret of the Black Moon', 'D0601', 7, '2021-04-20', 2020, '87 min', 'Kid magician Rudra sets out to save Earth from the demon of Black Moon planet, but can he get the job done if his spells dont work on enemy territory?'),
('s1011', 'Movie', 'Rudra: The Rise of King Pharaoh', 'D0002', 7, '2021-04-20', 2019, '91 min', 'When a malicious, resurrected mummy begins to steal the energy of young people in Mumbai, kid magician Rudra must use his special powers to stop him.'),
('s1012', 'Movie', 'Free to Play', 'D0002', 4, '2021-04-19', 2014, '76 min', 'This documentary follows three professional video game players as they compete in an international tournament with a million-dollar prize.'),
('s1013', 'TV Show', 'Luis Miguel - The Series', 'D0002', 2, '2021-04-19', 2021, '2 Seasons', 'This series dramatizes the life story of Mexican superstar singer Luis Miguel, who has captivated audiences in Latin America and beyond for decades.'),
('s1014', 'Movie', 'Miss Sloane', 'D0602', 8, '2021-04-19', 2016, '132 min', 'A tenacious Capitol Hill lobbyist with a well-earned reputation for winning takes on the most challenging battle of her career.'),
('s1015', 'TV Show', 'PJ Masks', 'D0002', 6, '2021-04-19', 2019, '3 Seasons', 'Three 6-year-old kids who live normal lives during the day become superheroes at night, fighting crime as a team known as PJ Masks.'),
('s1016', 'Movie', 'American Me', 'D0603', 8, '2021-04-17', 1992, '126 min', 'Three friends born in poverty create their own capitalist dream as powerful gang members. Time in prison makes one of them consider a fresh beginning.'),
('s1017', 'Movie', 'Delhi Belly', 'D0604', 2, '2021-04-17', 2011, '101 min', 'Three flatmates get involved in the shady business belonging to one roomie\'s fianc, and discover that a global crime syndicate is gunning for them.'),
('s1018', 'Movie', 'Dhobi Ghat (Mumbai Diaries)', 'D0605', 2, '2021-04-17', 2010, '102 min', 'In this intimate drama, circumstances draw together four people from different castes  which would normally preclude them from forming friendships.'),
('s1019', 'Movie', 'Jaane Tu... Ya Jaane Na', 'D0606', 4, '2021-04-17', 2008, '147 min', 'Soft-spoken Jai and spitfire beauty Aditi couldn\'t be more different  but their family and friends know that they\'re a perfect match.'),
('s102', 'Movie', 'Untold: Breaking Point', 'D0057', 2, '2021-09-07', 2021, '80 min', 'Under pressure to continue a winning tradition in American tennis, Mardy Fish faced mental health challenges that changed his life on and off the court.'),
('s1020', 'Movie', 'Lagaan', 'D0607', 3, '2021-04-17', 2001, '224 min', 'In 1890s India, an arrogant British commander challenges the harshly taxed residents of Champaner to a high-stakes cricket match.'),
('s1021', 'Movie', 'Madness in the Desert', 'D0608', 4, '2021-04-17', 2004, '141 min', 'The story of making \"Lagaan,\" one of the millennium\'s seminal Indian films, is told from the point of view of production team member Satyajit Bhatkal.'),
('s1022', 'Movie', 'Peepli Live', 'D0609', 2, '2021-04-17', 2010, '109 min', 'Two indigent farmers consider suicide so that their families can collect a government subsidy that\'s paid to the relatives of deceased farmers.'),
('s1023', 'Movie', 'Taare Zameen Par', 'D0610', 3, '2021-04-17', 2007, '162 min', 'When daydreamer Ishaan is sent to boarding school, an unconventional art teacher tries to help the imaginative student discover his true identity.'),
('s1024', 'Movie', 'Ajeeb Daastaans', 'D0611', 2, '2021-04-16', 2021, '142 min', 'Four shorts explore the surprising ways in which unexpected catalysts inflame the uncomfortable emotions simmering under fractured relationships.'),
('s1025', 'Movie', 'Arlo the Alligator Boy', 'D0612', 7, '2021-04-16', 2021, '93 min', 'To find the father he never knew, optimistic Arlo leaves his swampy Southern home for New York City, making friends along the way. A musical adventure.'),
('s1026', 'TV Show', 'Bakugan: Geogan Rising', 'D0002', 7, '2021-04-16', 2021, '1 Season', 'The Awesome Brawlers band together to fight off a powerful enemy determined to break the bond between Earth and Vestroia, the Bakugan\'s home planet.'),
('s1027', 'Movie', 'Barbie & Chelsea: The Lost Birthday', 'D0613', 6, '2021-04-16', 2021, '60 min', 'When Barbies sister Chelsea thinks her birthday has been skipped, she hunts for a magic gem on a jungle island that will grant her wish to get it back.'),
('s1028', 'Movie', 'Crimson Peak', 'D0614', 8, '2021-04-16', 2015, '119 min', 'After marrying a mysterious British aristocrat, a young heiress moves into his crumbling, creepy ancestral home and finds it conceals sinister secrets.'),
('s1029', 'Movie', 'Dad Stop Embarrassing Me - The Afterparty', 'D0002', 4, '2021-04-16', 2021, '37 min', 'Jamie Foxx, David Alan Grier and more from the cast of the family comedy discuss the show, humiliating family moments, bad BBQ dishes and sitcom openings.'),
('s103', 'TV Show', 'Countdown: Inspiration4 Mission to Space', 'D0058', 4, '2021-09-06', 2021, '1 Season', 'From training to launch to landing, this all-access docuseries rides along with the Inspiration4 crew on the first all-civilian orbital space mission.'),
('s1030', 'Movie', 'Doctor Bello', 'D0615', 2, '2021-04-16', 2013, '96 min', 'A troubled doctor sets out to save the life of a miracle worker who cured his cancer patient using an unprecedented and mysterious remedy.'),
