('s962', 'Movie', 'The Mitchells vs. The Machines', 'D0571', 3, '2021-04-30', 2021, '114 min', 'A robot apocalypse put the brakes on their cross-country road trip. Now its up to the Mitchells  the worlds weirdest family  to save the human race.'),
('s963', 'Movie', 'The Strangers: Prey at Night', 'D0572', 8, '2021-04-30', 2018, '85 min', 'Home-invasion horror comes to the trailer park when a family arrives at a mobile home community to find nobody there but a trio of masked murderers.'),
('s964', 'TV Show', 'The Unremarkable Juanquini', 'D0002', 2, '2021-04-30', 2021, '2 Seasons', 'An inept magician pulls off the trick of his life: accidentally disappearing a wanted criminal during a police raid. Now he\'s going to pay for that.'),
('s965', 'Movie', 'Things Heard & Seen', 'D0573', 2, '2021-04-29', 2021, '121 min', 'A young woman discovers that both her husband and their new home harbor sinister secrets after they leave Manhattan for small-town life.'),
('s966', 'TV Show', 'Yasuke', 'D0002', 2, '2021-04-29', 2021, '1 Season', 'A peaceful boatman once known as the Black Samurai is pulled back into conflict when he takes a little girl with mysterious powers under his wing.'),
('s967', 'Movie', 'Get the Grift', 'D0574', 2, '2021-04-28', 2021, '95 min', 'After a botched scam, Clvis bumps into Lohane, his estranged foster sister. In a bind, they soon realize the only way out is to band together.'),
('s968', 'TV Show', 'Headspace Guide to Sleep', 'D0002', 9, '2021-04-28', 2021, '1 Season', 'Learn how to sleep better with Headspace. Each episode unpacks misconceptions, offers friendly tips and concludes with a guided wind-down.'),
('s969', 'TV Show', 'Sexify', 'D0002', 2, '2021-04-28', 2021, '1 Season', 'To build an innovative sex app and win a tech competition, a sexually inexperienced student and her friends must explore the daunting world of intimacy.'),
('s97', 'Movie', 'If I Leave Here Tomorrow: A Film About Lynyrd Skynyrd', 'D0056', 2, '2021-09-07', 2018, '97 min', 'Using interviews and archival footage, this documentary charts the story of the legendary Southern rockers with a focus on front man Ronnie Van Zant.'),
('s970', 'Movie', 'August: Osage County', 'D0575', 8, '2021-04-27', 2014, '121 min', 'When their father disappears, three strong-willed women return to their childhood home and to their equally strong-willed mother.'),
('s971', 'Movie', 'Battle: Los Angeles', 'D0576', 1, '2021-04-27', 2011, '116 min', 'Led by their skillful staff sergeant, a platoon of gutsy Marines fights to protect all humankind from astonishingly powerful aliens.'),
('s972', 'Movie', 'Between Worlds', 'D0577', 8, '2021-04-27', 2018, '91 min', 'Grieving for his dead wife and daughter, a trucker plunges into a romance with a mother who needs his help. The dead, however, are far from gone.'),
('s973', 'TV Show', 'Fatma', 'D0002', 2, '2021-04-27', 2021, '1 Season', 'Reeling from tragedy, a nondescript house cleaner embarks on a murderous streak as she searches for her missing husband and reckons with old wounds.'),
('s974', 'Movie', 'One', 'D0578', 5, '2021-04-27', 2020, '149 min', 'A formidable Kerala chief ministers party loyalties and personal principles are tested when a damning social media post sparks a heated power struggle.'),
('s975', 'Movie', 'Ram Prasad Ki Tehrvi', 'D0579', 4, '2021-04-24', 2019, '113 min', 'Conflicts, complications and confrontations make for an emotional and eventful affair when a multigenerational family reunites in Lucknow.'),
('s976', 'Movie', 'Shadow and Bone - The Afterparty', 'D0002', 4, '2021-04-24', 2021, '33 min', 'Stars of Netflix\'s \"Shadow and Bone\" discuss the show\'s epic combat scenes, answer some fan questions and play an \"Army vs. Crows\" trivia game.'),
('s977', 'Movie', 'Among Family', 'D0580', 4, '2021-04-23', 2017, '127 min', 'Amid a marital crisis, Fikret befriends songstress Solmaz after a wacky encounter and must fill in as the father of her soon-to-wed daughter.'),
('s978', 'Movie', 'Dedemin Fisi', 'D0581', 4, '2021-04-23', 2016, '101 min', 'When a brain-dead family patriarch is about to be taken off life support, his extended family gathers round and plots to see who\'ll get his money.'),
('s979', 'Movie', 'Deliha', 'D0582', 2, '2021-04-23', 2014, '102 min', 'Short on sense but long on self-confidence, dotty Deliha sets her sights on a hunky photographer who opens up shop in her neighborhood.'),
('s98', 'TV Show', 'Kid Cosmic', 'D0002', 7, '2021-09-07', 2021, '2 Seasons', 'A boy\'s superhero dreams come true when he finds five powerful cosmic stones. But saving the day is harder than he imagined  and he can\'t do it alone.'),
('s980', 'Movie', 'Dn Dernek', 'D0583', 2, '2021-04-23', 2013, '102 min', 'On the first day of Ramadan, Ismail joins friends on a road trip to a mosque and encounters his son, who, to Ismail\'s chagrin, plans a hasty wedding.'),
('s981', 'Movie', 'Dgn Dernek 2: Snnet', 'D0584', 2, '2021-04-23', 2015, '107 min', 'Ismail and his old screwball crew land themselves in hot water when his grandson\'s circumcision evolves into a buzz-making citywide event.'),
('s982', 'Movie', 'G.O.R.A', 'D0585', 2, '2021-04-23', 2004, '123 min', 'Carpet dealer and UFO photo forger Arif is abducted by aliens. On the planet Gora, he helps friends escape from a meteorite strike and find freedom.'),
('s983', 'Movie', 'Hayat pcg', 'D0586', 4, '2021-04-23', 2015, '98 min', 'High-strung Metin finally stops seeing doom and gloom around every corner when he meets vivacious Hayat, but she has her own soul-searching to do.'),
('s984', 'Movie', 'Heroes: Silence and Rock & Roll', 'D0587', 2, '2021-04-23', 2021, '95 min', 'An exploration of the rise of Hroes del Silencio, the seminal 1980s Spanish rock band. Anchored by Enrique Bunbury, they focused on a harder sound.'),
('s985', 'Movie', 'Kara Bela', 'D0588', 2, '2021-04-23', 2015, '101 min', 'The uneventful life of middle-aged Kudret turns upside down when a road trip turns into a wild race for survival with killers in hot pursuit.'),
('s986', 'Movie', 'Kocan Kadar Konus', 'D0589', 2, '2021-04-23', 2015, '104 min', 'A 30-year-old who\'s never taken the traditional path to love is tutored by her friends and family before reconnecting with her high school crush.'),
('s987', 'Movie', 'Kocan Kadar Konus 2: Dirilis', 'D0589', 4, '2021-04-23', 2016, '104 min', 'Efsun has found Mr. Right in Sinan, and their relationship is taking a serious turn. But their eccentric families quickly complicate the romance.'),
('s988', 'Movie', 'Legal Hash', 'D0590', 2, '2021-04-23', 2019, '103 min', 'After a failed heist leads to a stint behind bars, a group of men reenters society with a risky business plan that soon reveals their true colors.'),
('s989', 'TV Show', 'Let\'s Fight Ghost', 'D0591', 4, '2021-04-23', 2021, '1 Season', 'A med student with a supernatural gift tries to cash in on his abilities by facing off against ghosts, till a wandering spirit brings romance instead.'),
('s99', 'TV Show', 'Octonauts: Above & Beyond', 'D0002', 6, '2021-09-07', 2021, '1 Season', 'The Octonauts expand their exploration beyond the sea and onto land! With new rides and new friends, they\'ll protect any habitats and animals at risk.'),
('s990', 'Movie', 'My Travel Buddy', 'D0592', 2, '2021-04-23', 2017, '111 min', 'Days before Eid, a salesman fired from his job drives to Ayvalk to meet his girlfriend\'s family, but the trip goes astray due to his zany travel buddy.'),
('s991', 'Movie', 'Niyazi Gl Drtnala', 'D0582', 2, '2021-04-23', 2015, '102 min', 'Seeking the formula behind a magical elixir bequeathed to him by his father, a veterinary professor gets embroiled in a mobster\'s horse-racing scheme.'),
('s992', 'Movie', 'One Like It', 'D0593', 9, '2021-04-23', 2020, '15 min', 'This short film follows a day in the life of a young woman in Egypt and how her interactions with others expose long-standing stereotypes and biases.'),
('s993', 'Movie', 'Perfume Imaginary Museum Time Warp', 'D0594', 9, '2021-04-23', 2020, '54 min', 'This visually stunning special performance was the highlight of Perfumes \"P.O.P\" Festival  the J-pop trios 20th anniversary online celebration.'),
('s994', 'TV Show', 'Shadow and Bone', 'D0002', 4, '2021-04-23', 2021, '1 Season', 'Dark forces conspire against orphan mapmaker Alina Starkov when she unleashes an extraordinary power that could change the fate of her war-torn world.'),
('s995', 'Movie', 'This Lady Called Life', 'D0181', 4, '2021-04-23', 2020, '120 min', 'Abandoned by her family, young single mother Aiye struggles to survive but stays focused on her dream of becoming an elite chef.'),
('s996', 'Movie', 'Vizontele', 'D0595', 2, '2021-04-23', 2001, '106 min', 'In 1974, a rural town in Anatolia gets its first television set  an event that\'s met with both excitement and trepidation by the villagers.'),
('s997', 'Movie', 'HOMUNCULUS', 'D0596', 2, '2021-04-22', 2021, '116 min', 'Truth and illusion blurs when a homeless amnesiac awakens from an experimental medical procedure with the ability to see people\'s innermost traumas.'),
('s998', 'TV Show', 'Life in Color with David Attenborough', 'D0002', 5, '2021-04-22', 2021, '1 Season', 'Using innovative technology, this docuseries explores nature from a fresh perspective as animals use color to survive and thrive in the wild.'),
('s999', 'Movie', 'Searching For Sheela', 'D0002', 4, '2021-04-22', 2021, '58 min', 'Journalists and fans await Ma Anand Sheela as the infamous former Rajneesh communes spokesperson returns to India after decades for an interview tour.');
